import React from 'react';
import { Link } from 'react-router-dom';

function ProductCard(props) {
  let date = new Date(1000 * props.product.last_updated_at);

  return (
    <div className={'border-2 p-4 mb-5'}>
      <div className={'bg-teal-100'}>{props.name}</div>
      <div className={'bg-teal-300'}>{`USD: $${props.product.usd}`}</div>
      <div
        className={'bg-teal-500'}
      >{`Updated At: ${date.toLocaleString()}`}</div>
      <div
        className={'bg-teal-700'}
      >{`24h Change: %${props.product.usd_24h_change}`}</div>
    </div>
  );
}

export default ProductCard;
